import { useEffect, useState } from "react"
import { useParams } from "react-router-dom"

function View2(){
    let {Id}=useParams()
    const[data,setData]=useState([])
    useEffect(()=>{
        fetch(`http://localhost:9000//${Id}`)
        .then(res=>res.json())
        .then(data=>setData(data))

    },[])
    return(
        <h1>Cataegers is {data.Id}</h1>
    )
}
export default View2
